const NewArticle = () => {
    const [name, setTitle] = useState()
    const [text, setText] = useState()

    console.log("xffe")
    return(
        <React.Fragment>
            <p>Hello</p>
            <label>Title:</label>
            <input type="text" value={name} onChange={(event) => setTitle(event.target.value)}/>
            <label>Content:</label>
            <textarea rows="200" cols="100" value={text} onChange={(event) => setText(event.target.value)}/>
        </React.Fragment>
    )
}

export default NewArticle;
